INSERT INTO `tl_faq` (`id`, `pid`, `sorting`, `tstamp`, `question`, `alias`, `author`, `answer`, `addImage`, `singleSRC`, `alt`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `noComments`, `published`) VALUES(1, 1, 128, 1424264096, 'Omnicos directe al desirabilite de un nov lingua franca?', 'omnicos-directe-al-desirabilite-de-un-nov-lingua-franca', 1, '<p>Sie kam wie Anblick von in, denn permanente so ein stärksten alten Zimmer. Die dem er weiterhin der. Und sprachen Großmüttern Gesellschaft begreifend aber, wenn daß schaute sein kaum. Besonders nun keinen aufnahm Genugtuung gegenwärtigen dienen, tatsächlich Hungern neuen Industrien einer.</p>', '', NULL, '', '', '', '', '', '', '', '1', 0x613a313a7b693a303b733a31363a220c0c7bf3583011e38ea1aa0000c076c6223b7d, '', '1');
INSERT INTO `tl_faq` (`id`, `pid`, `sorting`, `tstamp`, `question`, `alias`, `author`, `answer`, `addImage`, `singleSRC`, `alt`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `noComments`, `published`) VALUES(2, 1, 256, 1424264125, 'On refusa continuar payar custosi traductores?', 'on-refusa-continuar-payar-custosi-traductores', 1, '<p>Immerhin übrige zu umgeben verschiedenen. Vernetzung zusammen der und aber gelacht in sich sein Vorsorge darüber. Nein verstanden trug er aus, Knöpfen ihn hatte Nase Schichten in, sank Buch wurde jenen des finden. Er starb worden einer jenen aus, der Milliarden eines den klopfte vieler. Sie auch benommen schienen Einkommen fand. Obwohl bereits sie in geläutet wurde.</p>', '', NULL, '', '', '', '', '', '', '', '1', 0x613a313a7b693a303b733a31363a220c0c7bf3583011e38ea1aa0000c076c6223b7d, '', '1');
INSERT INTO `tl_faq` (`id`, `pid`, `sorting`, `tstamp`, `question`, `alias`, `author`, `answer`, `addImage`, `singleSRC`, `alt`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `noComments`, `published`) VALUES(3, 1, 64, 1424264023, 'Li Europan lingues es membres del sam familie?', 'li-europan-lingues-es-membres-del-sam-familie', 1, '<p>Er sein die geringsten sie setzte, nachdem den der sie erfasste, denn sie kaum von Gewohnheit sonst aber Vorteil von gelb, wenn gelaufen niemand eine nie im, wohl man einem brachte Susanne auf und. Lassen zu Waagschale in typischen, was von er befremdet permanente. Und er seine Leser gestiftet. Im besseren ich ans Schlimmste. Das schneller einer gekleidet eines Hut, stiegen den man Josef organisierten, standen Weise Industriestaaten.</p>', '', NULL, '', '', '', '', '', '', '', '1', 0x613a313a7b693a303b733a31363a220c0c7bf3583011e38ea1aa0000c076c6223b7d, '', '1');
INSERT INTO `tl_faq` (`id`, `pid`, `sorting`, `tstamp`, `question`, `alias`, `author`, `answer`, `addImage`, `singleSRC`, `alt`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `noComments`, `published`) VALUES(4, 1, 96, 1424264067, 'Li nov lingua franca regulari quam li existent Europan lingues?', 'li-nov-lingua-franca-regulari-quam-li-existent-europan-lingues', 1, '<p>Er sein die geringsten sie setzte, nachdem den der sie erfasste, denn sie kaum von Gewohnheit sonst aber Vorteil von gelb, wenn gelaufen niemand eine nie im, wohl man einem brachte Susanne auf und. Lassen zu Waagschale in typischen, was von er befremdet permanente.</p>', '', NULL, '', '', '', '', '', '', '', '1', 0x613a313a7b693a303b733a31363a220c0c7bf3583011e38ea1aa0000c076c6223b7d, '', '1');
