INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `subheadline`, `teaser`, `addImage`, `singleSRC`, `alt`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`) VALUES(1, 1, 1433334767, 'Gute Neuigkeiten!', 'gute-neuigkeiten-1', 1, 1457562180, 1457562180, '', '<p>Zweitens: ich habe erklärt mit diese zwei Spieler: nach Dortmund brauchen vielleicht Halbzeit Pause. Ich habe auch andere Mannschaften gesehen in Europa nach diese Mittwoch. Ich habe gesehen auch zwei Tage die Training. Ein Trainer ist nicht ein Idiot! Ein Trainer sei sehen was passieren in Platz. In diese Spiel es waren zwei, drei diese Spieler waren schwach wie eine Flasche leer! Haben Sie gesehen Mittwoch, welche Mannschaft hat gespielt Mittwoch?</p>', '1', 0xff80bbc209e811e5b17aaa0000f461f4, '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:12:"proportional";}', 'a:5:{s:6:"bottom";s:2:"10";s:4:"left";s:0:"";s:5:"right";s:2:"10";s:3:"top";s:0:"";s:4:"unit";s:2:"px";}', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '', '1', '', '');
INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `subheadline`, `teaser`, `addImage`, `singleSRC`, `alt`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`) VALUES(2, 1, 1433518623, 'Unser Unternehmen ist 10 Jahre alt!', 'unser-unternehmen-ist-10-jahre-alt', 1, 1447367040, 1447367040, '', '<p>Dies ist ein Typoblindtext. An ihm kann man sehen, ob alle Buchstaben da sind und wie sie aussehen. Manchmal benutzt man Worte wie Hamburgefonts, Rafgenduks oder Handgloves, um Schriften zu testen. Manchmal Sätze, die alle Buchstaben des Alphabets enthalten - man nennt diese Sätze »Pangrams«. Sehr bekannt ist dieser: The quick brown fox jumps over the lazy old dog.</p>', '1', 0xff80bba509e811e5b17aaa0000f461f4, '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:12:"proportional";}', 'a:5:{s:6:"bottom";s:2:"10";s:4:"left";s:0:"";s:5:"right";s:2:"10";s:3:"top";s:0:"";s:4:"unit";s:2:"px";}', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '', '1', '', '');
INSERT INTO `tl_news` (`id`, `pid`, `tstamp`, `headline`, `alias`, `author`, `date`, `time`, `subheadline`, `teaser`, `addImage`, `singleSRC`, `alt`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `source`, `jumpTo`, `articleId`, `url`, `target`, `cssClass`, `noComments`, `featured`, `published`, `start`, `stop`) VALUES(3, 1, 1433518612, 'So war die Messe in Frankfurt', 'besucht-uns-auf-der-messe-in-frankfurt', 1, 1449613440, 1449613440, '', '<p>Es gibt im Moment in diese Mannschaft, oh, einige Spieler vergessen ihnen Profi was sie sind. Ich lese nicht sehr viele Zeitungen, aber ich habe gehört viele Situationen. Erstens: wir haben nicht offensiv gespielt. Es gibt keine deutsche Mannschaft spielt offensiv und die Name offensiv wie Bayern.</p>\n<p>Letzte Spiel hatten wir in Platz drei Spitzen: Elber, Jancka und dann Zickler. Wir müssen nicht vergessen Zickler. Zickler ist eine Spitzen mehr, Mehmet eh mehr Basler. Ist klar diese Wörter, ist möglich verstehen, was ich hab gesagt? Danke. Offensiv, offensiv ist wie machen wir in Platz.</p>', '1', 0xff80bbb409e811e5b17aaa0000f461f4, '', 'a:3:{i:0;s:0:"";i:1;s:0:"";i:2;s:12:"proportional";}', 'a:5:{s:6:"bottom";s:2:"10";s:4:"left";s:0:"";s:5:"right";s:2:"10";s:3:"top";s:0:"";s:4:"unit";s:2:"px";}', '', '', '', 'above', '', NULL, 'default', 0, 0, '', '', '', '', '', '1', '', '');
